window.bookSummaryJSON = "<p><b>“His instinct is to kill me. His desire is to love me.”</b></p> <p>Six years ago strangers broke into my house while I was home alone. I hid, but one of them found me. I expected death, but he spared me.</p> <p>I thought it was over … except for the nightmares. But he was only waiting for me to ripen to his taste.</p> <p>I’m not the first girl he’s taken to sate his dark hunger, but I will be the last.</p>"; 
